from collections import defaultdict
import time


def most_frequent_k_mer(word, k):
    max = 0
    k_mers = []
    freq = defaultdict(int)
    for i in range(len(word) - k):
        freq[word[i:i + k]] = freq[word[i:i + k]] + 1

    for key in freq.keys():
        if freq[key] > max:
            max = freq[key]
            k_mers = [key]
        elif freq[key] == max:
            k_mers.append(key)

    for k_mer in k_mers:
        print(k_mer, )


def count_pattern(string, pattern):
    l = len(pattern)
    count = 0
    for i in range(len(string) - l + 1):
        if string[i: i + l] == pattern:
            count += 1
    return count


def clump_k_mer(genome, k, l, t):
    k_mers = set()
    for i in range(len(genome) - l + 1):
        freq = defaultdict(int)
        clump = genome[i: i + l]

        for j in range(l - k + 1):
            freq[clump[j:j + k]] = freq[clump[j:j + k]] + 1

        for key, value in freq.items():
            if value >= t:
                k_mers.add(key)
                # print(key)

    for i in k_mers:
        print(i)


def efficient_clumping(genome, k, l, t):
    initial = genome[:l]
    freq = defaultdict(int)
    k_mers = set()
    for j in range(l - k + 1):
        freq[initial[j:j + k]] = freq[initial[j:j + k]] + 1

    for key, value in freq.items():
        if value >= 4:
            k_mers.add(key)

    for i in range(1, len(genome) - l + 1):
        freq[genome[i:i + k]] = freq[genome[i:i + k]] - 1
        freq[genome[i + l - k + 1:i + l + 1]] = freq[genome[i + l - k + 1:i + l + 1]] + 1

        if freq[genome[i + l - k + 1:i + l + 1]] >= t:
            k_mers.add(genome[i + l - k + 1:i + l + 1])

    for i in k_mers:
        print(i)
    print(len(k_mers))


